import React from "react";

function Todo(){
   
  return(
    <div>
       <h1>To Do - List</h1>
       <form action="">
        Entrez Une Tache : <input type="text" name="" id="" />
        <input type="button" value="Ajouter" className="btn-primary"/>
        <h2>Liste des Choses a Faire</h2>
       </form>
    </div>
  );
}
export default Todo
